import { createAsyncThunk, createSlice } from "@reduxjs/toolkit";



const aboutSlice = createSlice({
      name: 'aboutSlice',
      initialState,
      reducers: {}
})







const { actions, reducer } = aboutSlice
export default reducer;
export const { } = actions;
